import axios from "axios";

// 获取左侧菜单栏信息， 需携带用户的ID
export function getSecondMenuInfos(userId) {
    console.log(userId)
    axios.get("https://yapi.pro/mock/44512/yyym/menu")
        .then(result => {
            console.log(result)
            if(result.data.code != 0){
                console.log(result.data.data)
                return result.data.data
            }
        })
}
